import React from 'react';
import {Button, Card, Form, Input} from "antd";

const LoginForm = () => {
    return (
        <>
            <Card>
                <Form>
                    <div>
                        <label>ID</label>
                        <Input name="userId"/>
                    </div>
                    <div>
                        <label>PW</label>
                        <Input name="userPassword"/>
                    </div>
                    <br/>
                    <div>
                        <Button type="primary">Login</Button>
                        <Button>Sign Up</Button>
                    </div>
                </Form>
            </Card>
        </>
    );
};

export default LoginForm;
